# Importaciones adicionales
import json
import re
from collections import Counter
from functools import reduce

# ==========================
# PROCESAMIENTO DE TEXTO AVANZADO
# ==========================

def contar_frecuencia_palabras(texto):
    """
    Cuenta la frecuencia de cada palabra en un texto.
    
    Args:
    texto (str): El texto a analizar
    
    Returns:
    dict: Un diccionario con las palabras y sus frecuencias
    """
    # Convertir a minúsculas y eliminar puntuación
    texto = re.sub(r'[^\w\s]', '', texto.lower())
    palabras = texto.split()
    return Counter(palabras)

def encontrar_palabra_mas_comun(texto):
    """
    Encuentra la palabra más común en un texto.
    
    Args:
    texto (str): El texto a analizar
    
    Returns:
    tuple: La palabra más común y su frecuencia
    """
    frecuencia = contar_frecuencia_palabras(texto)
    return max(frecuencia.items(), key=lambda x: x[1])

# ==========================
# MANEJO DE JSON
# ==========================

def guardar_json(datos, nombre_archivo):
    """
    Guarda datos en formato JSON en un archivo.
    
    Args:
    datos (dict): Los datos a guardar
    nombre_archivo (str): Nombre del archivo JSON
    """
    with open(nombre_archivo, 'w') as f:
        json.dump(datos, f, indent=4)

def cargar_json(nombre_archivo):
    """
    Carga datos desde un archivo JSON.
    
    Args:
    nombre_archivo (str): Nombre del archivo JSON
    
    Returns:
    dict: Los datos cargados del archivo
    """
    with open(nombre_archivo, 'r') as f:
        return json.load(f)

# ==========================
# PROGRAMACIÓN FUNCIONAL
# ==========================

def aplicar_operaciones(numero, operaciones):
    """
    Aplica una serie de operaciones a un número.
    
    Args:
    numero (int): El número inicial
    operaciones (list): Lista de funciones a aplicar
    
    Returns:
    int: El resultado después de aplicar todas las operaciones
    """
    return reduce(lambda x, func: func(x), operaciones, numero)

# Ejemplo de operaciones
duplicar = lambda x: x * 2
sumar_cinco = lambda x: x + 5
elevar_al_cuadrado = lambda x: x ** 2

# ==========================
# MANEJO AVANZADO DE LISTAS
# ==========================

def aplanar_lista(lista):
    """
    Aplana una lista que contiene sublistas a cualquier nivel.
    
    Args:
    lista (list): La lista a aplanar
    
    Returns:
    list: Una lista aplanada
    """
    resultado = []
    for elemento in lista:
        if isinstance(elemento, list):
            resultado.extend(aplanar_lista(elemento))
        else:
            resultado.append(elemento)
    return resultado

# ==========================
# GENERADORES AVANZADOS
# ==========================

def fibonacci_infinito():
    """
    Generador que produce números de Fibonacci infinitamente.
    
    Yields:
    int: El siguiente número de Fibonacci
    """
    a, b = 0, 1
    while True:
        yield a
        a, b = b, a + b

# ==========================
# DECORADORES CON ARGUMENTOS
# ==========================

def repetir(veces):
    """
    Decorador que repite la ejecución de una función un número específico de veces.
    
    Args:
    veces (int): Número de veces que se repetirá la función
    
    Returns:
    function: Decorador configurado
    """
    def decorador_repetir(func):
        def wrapper(*args, **kwargs):
            for _ in range(veces):
                resultado = func(*args, **kwargs)
            return resultado
        return wrapper
    return decorador_repetir

@repetir(3)
def saludar(nombre):
    print(f"Hola, {nombre}!")

# ==========================
# FUNCIÓN PRINCIPAL EXTENDIDA
# ==========================

def main():
    # ... (código anterior)

    # Procesamiento de texto avanzado
    texto_largo = "Este es un ejemplo de un texto largo. Este texto tiene palabras repetidas. Python es genial para procesar texto."
    print("Frecuencia de palabras:", contar_frecuencia_palabras(texto_largo))
    palabra_comun, frecuencia = encontrar_palabra_mas_comun(texto_largo)
    print(f"Palabra más común: '{palabra_comun}' (aparece {frecuencia} veces)")

    # Manejo de JSON
    datos = {"nombre": "Juan", "edad": 30, "ciudad": "Madrid"}
    guardar_json(datos, "datos.json")
    datos_cargados = cargar_json("datos.json")
    print("Datos cargados del JSON:", datos_cargados)

    # Programación funcional
    numero_inicial = 5
    operaciones = [duplicar, sumar_cinco, elevar_al_cuadrado]
    resultado = aplicar_operaciones(numero_inicial, operaciones)
    print(f"Resultado después de aplicar operaciones a {numero_inicial}: {resultado}")

    # Aplanar lista
    lista_anidada = [1, [2, [3, 4]], 5, [6, 7]]
    print("Lista aplanada:", aplanar_lista(lista_anidada))

    # Uso del generador de Fibonacci
    fib = fibonacci_infinito()
    print("Primeros 10 números de Fibonacci:")
    for _ in range(10):
        print(next(fib), end=" ")
    print()  # Salto de línea

    # Uso del decorador con argumentos
    saludar("Mundo")

if __name__ == "__main__":
    main()


